 import './App.css';
import About from './component/About';
import Navbar from './component/Navbar';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <div className="App">

    <Router>
     <Navbar/>
     <Switch>
          <Route path="/">
            <Home/>
          </Route>
          <Route path="/about">
             <About/>
          </Route>

        </Switch>
    </Router>
    </div>
  );
}

export default App;
